// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import logoImg from "../../images/User/online-learning.png"


function Footer(){
  return(
  // <section id='footer'>
  //    <footer>
  //     <div className="mt-4" style={{backgroundColor:"#D8C4B6", marginTop:"50px",height:"250px"}}>
  //     <div className="row"> 
  //       <div className="col" style={{marginTop:"20px",marginLeft:"60px"}}>
  //         <h5><b>iSchool</b></h5>
  //         <p>
  //           329,Sterling Center Camp,Pune<br></br>
  //           Maharashtra 411001,India
  //           </p>
  //       </div>
  //       <div className="col"  style={{marginTop:"20px"}}>
  //         <h5>Contact us</h5>
  //         <p>+9556569676 <br></br>
  //         Email- iSchool12.gmail.com <br></br>
  //         Mon-Sat 9am-3pm 
  //         </p>
  //       </div>
  //       <div className="col"  style={{marginTop:"20px"}}>
  //         <h5>Company</h5>
  //         <li>About us</li>
  //         <li>Careers</li>
  //         <li>Terms</li>
  //         <li>Privacy policy</li>
  //       </div>
  //       <div className="icons">
  //           <img src="../../images/User/Twiter.jpg" width={50} height={30} style={{marginLeft:"1000px",marginTop:"20px"}}/>
  //           <img src="./image/Twiter.jpg" width={50} height={30} style={{marginLeft:"20px",marginTop:"20px"}}/>
  //           <img src="./image/Facebook.png" width={50}  height={30} style={{marginLeft:"20px",marginTop:"20px"}}/>
  //           <img src="./image/Github.png" width={50}  height={30} style={{marginLeft:"20px",marginTop:"20px"}}/>
  //         </div>
         
  //      </div>
      
  //     </div>
      
  //       </footer>
  //     </section>
  
  

<footer class="bg-[#D8C4B6] dark:bg-gray-900">
    <div class="mx-auto w-full max-w-screen-xl p-2  lg:p-3">
        <div class="md:flex md:justify-between">
          <div class="mb-2 md:mb-0">
              <a href="https://flowbite.com/" class="flex items-center">
                  <img src={logoImg} class="h-6 me-2" alt="ELearn Logo" />
                  <span class="self-center text-lg font-semibold whitespace-nowrap dark:text-white">ELearn</span>
              </a>
          </div>
          <div class="grid grid-cols-2 gap-3 sm:grid-cols-3">
              <div>
                  <h2 class="mb-2 text-xs font-semibold text-gray-900 uppercase dark:text-white">Resources</h2>
                  <ul class="text-gray-500 dark:text-gray-400 font-xs">
                      <li>
                          <a href="/home" class="hover:underline">ELearn</a>
                      </li>
                      <li>
                          <a href="https://tailwindcss.com/" class="hover:underline">Tailwind CSS</a>
                      </li>
                  </ul>
              </div>
              <div>
                  <h2 class="mb-2 text-xs font-xs text-gray-900 uppercase dark:text-white">Follow us</h2>
